pragma solidity >=0.4.25 <0.7.0;
pragma experimental ABIEncoderV2;

contract NoNoShow{
  // DB  
  address payable creator;
  struct books{
    bytes32 compID;
    bytes32 keyID;
    string compName; // 
    string custName; //  
    string custPN; //  
    uint32 date; // 20201414
    uint32 time; // 1130
    uint32 personnel; // 
    bool isShow; // false true
  }

  // DB
  struct custDB{
    bytes32 keyID; // + 
    string phoneNumber;
    string name;
    string ID;
    string PW;
    uint32 showCnt;
    uint32 noShowCnt;
    uint32 age;
    // ,    
  }
  struct compDB{//comp  company
    bytes32 compID;
    uint32 startTime; // 
    string comName;
    string ID;
    string PW;
    string addr; //  
    string phoneNumber; //  
    string img; //   
    string description; //  
    //      
  }
  mapping(string=>custDB) userCust;//   DB
  mapping(string=>compDB) userComp;//   DB
  mapping(bytes32=>books[]) LedgerDB;//      DB
  mapping(bytes32=>books[]) compBooks;// c.f.)        DB
  books[] resBooks; //      
  //    : mapping(=>) , string[]       
  //   (       .)
  event alertToComp(bytes32 keyID,bytes32 compID, uint32 date, uint32 time, uint personnel);
  event alertToCust(bytes32 keyID, bool ack);
  // 
  constructor () public{
    creator = msg.sender; //    creator     .
  }

  // 
  function custSignUp(string memory phoneNumber,string memory name,string memory id, string memory pw, uint32 age) public returns(bool){
    if(bytes(userCust[id].ID).length==0){//   ,    ID 0  
      //c.f.)     delete userCust[phoneNumber]  
      bytes32 keyID = keccak256( abi.encodePacked( phoneNumber,name,id,pw,age ) );
      userCust[id] = custDB(keyID,phoneNumber,name,id,pw,0,0,age); // keyID , +"1234"  .
      return true;
    }
    return false;
  }
  function custLogIn(string memory id, string memory pw) public view returns(string memory,bytes32 keyID,bool pass){//
    if(keccak256(abi.encodePacked((userCust[id].ID)))  == keccak256(abi.encodePacked((id))) && keccak256(abi.encodePacked((userCust[id].PW))) == keccak256(abi.encodePacked((pw)))){
      return ("client",userCust[id].keyID,true);
    }
    return ("","",false);
  }
  function book(bytes32 keyID,bytes32 compID,uint32 date, uint32 time, uint32 personnel)public{
    emit alertToComp(keyID,compID,date,time, personnel); //    .  Tx   .
  }
  // 
  function compSignUp(string memory compName,uint32 startTime, string memory id, string memory pw ,string memory addr,string memory phoneNumber, string memory img, string memory description) public returns(bool){
    if(bytes(userComp[id].ID).length==0){//   ,    ID 0  
      //c.f.)     delete userCust[phoneNumber]  
      bytes32 compID = keccak256( abi.encodePacked( phoneNumber,compName,id,pw ) );
      userComp[id] = compDB(compID, startTime, compName, id, pw, addr, phoneNumber, img, description);
      return true;
    }
    return false;
  }
  //function changeCompInfo() =>        .

  function compLogIn(string memory id, string memory pw) public view returns(string memory,bytes32 compID, bool pass){ //    ..
    if(keccak256(abi.encodePacked((userComp[id].ID)))  == keccak256(abi.encodePacked((id))) && keccak256(abi.encodePacked((userComp[id].PW))) == keccak256(abi.encodePacked((pw)))){
      return ("comp",userComp[id].compID,true); //     keccack256  .(string  )
    }
    return ("","",false);
  }
  ////   
  function bookList(bytes32 compID,uint32 date) public returns(books[] memory){ //  ID     
    delete resBooks;
    for(uint32 i = uint32(compBooks[compID].length-1);i>=0;i--){
        if(compBooks[compID][i].date == date){
            resBooks.push(compBooks[compID][i]);
        }
    }
    return resBooks;
  }
  function ackBook(bytes32 compID,bytes32 keyID,string memory compName,string memory custName, string memory custPN, uint32 date,uint32 time,uint32 personnel, bool ack) public{
    if(ack){
      LedgerDB[keyID].push(books(compID,keyID,compName,custName,custPN,date,time,personnel, false));
      compBooks[compID].push(books(compID,keyID,compName,custName,custPN,date,time,personnel, false));
    }
    emit alertToCust(keyID, ack);
  }
  function resBook(bytes32 keyID,bytes32 compID, uint32 date, bool isShow) public{ //     
    for(uint32 i = uint32(LedgerDB[keyID].length - 1);i>=0;i--){
        if(LedgerDB[keyID][i].date == date){
            LedgerDB[keyID][i].isShow = isShow;
            break;
        }
    }
    for(uint32 i = uint32(compBooks[compID].length - 1);i>=0;i--){
        if(compBooks[compID][i].date == date){
            compBooks[compID][i].isShow = isShow;
            break;
        }
    }
  }
  function callBook(bytes32 compID,string memory phoneNumber,string memory compName,string memory custName, string memory custPN, uint32 date,uint32 time, uint32 personnel) public {//     
    bytes32 keyID = userCust[phoneNumber].keyID;
    LedgerDB[keyID].push(books(compID,keyID,compName,custName,custPN,date,time,personnel,false));
    compBooks[compID].push(books(compID,keyID,compName,custName,custPN,date,time,personnel,false));
    emit alertToCust(keyID, true);
  }
  //   
  function checkUser(string memory phoneNumber,uint32 idx) public returns(books[] memory){ //     
    delete resBooks;
    uint32 bookLength = uint32(LedgerDB[userCust[phoneNumber].keyID].length);
    bytes32 keyID = userCust[phoneNumber].keyID;
    for(uint32 i = bookLength - 1;i>bookLength-1-idx || i>=0;i--){
        resBooks.push(LedgerDB[keyID][i]);
    }
    return resBooks;
  }
}
